class LoginResponse {  String? tokenType;  String? tokenBody;  String? refreshToken;  String? userName;  String? timestamp;  LoginResponse({this.tokenType, this.tokenBody, this.refreshToken, this.userName, this.timestamp});  LoginResponse.fromJson(Map<String, dynamic> json) {    tokenBody = json['tokenBody'];    tokenType = json['tokenType'];    refreshToken = json['refreshToken'];    userName = json['userName'];    timestamp = json['timestamp'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = <String, dynamic>{};    data['tokenType'] = tokenType;    data['tokenBody'] = tokenBody;    data['refreshToken'] = refreshToken;    data['userName'] = userName;    data['timestamp'] = timestamp;    return data;  }  @override  String toString() {    return 'LoginResponse{'        'tokenType: $tokenType,'        ' tokenBody: $tokenBody, '        'refreshToken: $refreshToken, '        'username: $userName,'        ' timestamp: $timestamp}';  }}